import React, { Component } from 'react';

class ProjectPage extends Component {
    render() {
        return (
            <div>
                <h1 className='header'>PROJECTS</h1>
                <p className='text'>These are some of my projects</p>
            </div>
        );
    }
}

export default ProjectPage;
